namespace Tests\App\Controllers;

use App\Controllers\MeasuresController;
use App\Handlers\MeasuresHandler;
use App\RoutesLoader;
use App\ServicesLoader;
use App\Utils\MetricsTypes;
use Symfony\Component\HttpFoundation\Request;
use Silex\WebTestCase;
use Silex\Application;
use Silex\Provider\DoctrineServiceProvider;
use Symfony\Component\HttpKernel\Client;
use Symfony\Component\HttpKernel\Exception\HttpException;

class MeasuresControllerTest extends WebTestCase
{
    /**
     * @var MeasuresController
     */
    private $controller;

    /**
     * @var Application
     */
    protected $app;
    
    public function createApplication()
    {
        $this->app = new Application();
        $this->app->register(new DoctrineServiceProvider(), array(
            "db.options" => array(
                "driver" => "pdo_sqlite",
                "memory" => true
            ),
        ));
        $servicesLoader = new ServicesLoader($this->app);
        $routesLoader = new RoutesLoader($this->app);
        $this->app = $routesLoader->bindRoutesToControllers();
        foreach (MetricsTypes::TYPES as $type) {
            $this->createInsert($type);
        }
    }

    public function setUp()
    {
        $this->createApplication();
    }

    public function testSave()
    {
        $json = $this->createArray();
        $client = $this->createClient();

        $client->request('POST', '/measures', [], [], [], $json);

        $response = $client->getResponse();
        $this->assertTrue($response->isOk());
    }

    public function testGetSpecificMeasure()
    {
        $client = $this->createClient();
        $unitId = 1;
        $day = 2;
        $hour = 14;

        $client->request('GET', sprintf('/measures/%d/%d/%d', $unitId, $day, $hour));

        $response = $client->getResponse();
        $this->assertTrue($response->isOk());
        $data = json_decode($response->getContent(), true);
        $expectedMetrics = [
            'download' => [
                'no_of_records' => '4',
                'minimum' => '100',
                'maximum' => '800',
                'mean' => '350.0',
                'median' => 250,
            ],
            'upload' => [
                'no_of_records' => '4',
                'minimum' => '100',
                'maximum' => '800',
                'mean' => '350.0',
                'median' => 250,
            ],
            'packet_loss' => [
                'no_of_records' => '4',
                'minimum' => '100',
                'maximum' => '800',
                'mean' => '350.0',
                'median' => 250,
            ],
            'latency' => [
                'no_of_records' => '4',
                'minimum' => '100',
                'maximum' => '800',
                'mean' => '350.0',
                'median' => 250,
            ],
        ];
        $this->assertSame($expectedMetrics, $data);
    }

    public function testGetSpecificMeasureFailsInCaseOfWrongParameters()
    {
        $client = $this->createClient();

        $client->request('GET', '/measures/15');

        $response = $client->getResponse();
        $this->assertFalse($response->isOk());
    }

    public function testGetSpecificMeasureFailsInCaseOneOfTheParameterHasWrongType()
    {
        $client = $this->createClient();
        $unitId = 1;
        $day = 2;
        $hour = "wrongType";

        $client->request('GET', sprintf('/measures/%d/%d/%d', $unitId, $day, $hour));

        $response = $client->getResponse();
        $this->assertFalse($response->isOk());
    }

